import React from "react";
// import ReactDOM from "react-dom";
// import Card from "./Card";
// import hospedagens from "./hospedagens";
// import { Button } from "react-bootstrap";
// import axios from "axios";
import { Casa } from "../../backend/entidades/casas";

class criarCards extends React.Component<Casa, any> {
  constructor(props: Casa) {
    super(props);

    this.state = {
      casas: [],
      dadosCarregados: false,
    };
  }

  componentDidMount() {
    fetch("http://localhost:4000/casas")
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          casas: json,
          dadosCarregados: true,
        });
      });
  }
  render() {
    const { dadosCarregados, casas } = this.state;
    if (!dadosCarregados) {
      return <h1>Carregando...</h1>;
    }

    return (
      <div className="App">
        <h1>Hospedagens</h1>{" "}
        {casas.map((casa: any) => (
          <ol key={casa.id}>
            Title: {casa.titulo}, Description: {casa.descricao}, Price: {casa.diaria}
          </ol>
        ))}
      </div>
    );
  }
}

export default criarCards;
